    return (
        <div className='layout'>
            <div className='container'>
                <div className='row'>
                    <div className='d-lg-none col-xl-2 col-xxl-2'>
                        <Sidebar />
                    </div>
                    <div className='col-lg-7 col-xl-6 col-xxl-6'>
                        <Content />
                    </div>
                    <div className='col-lg-5 col-xl-4 col-xxl-4'>
                        <Description />
                    </div>
                </div>
            </div>
        </div>
    )
}

export default index
